import React from 'react';
import Header from '../components/header';
import { Divider } from 'antd';
import 'src/assets/main.css'

const Home = () => {
    return (
        <div>
            <Header />
            <Divider />
            <h1>Welcome to Your Website</h1>
            <p>This is the main page of your website.</p>
        </div>
    );
};

export default Home;
